import "./ExpenseItem.css";

function ExpenseItemTable() {
  const expenseDate = new Date(2021, 2, 28);
  const expenseTitle = "Car Insurance";
  const expenseAmount = 294.67;

  return (
    <div className="expense-item">
      <table width="100%">
        <td>{expenseDate.toISOString()}</td>
        <td className="expense-Item__description">
          <h2>{expenseTitle}</h2>
        </td>
        <td className="expense-item__price">${expenseAmount}</td>
      </table>
    </div>
  );
}

export default ExpenseItemTable;
